import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { getPendingActions, supportAction } from '../services/api';

const PendingActionsContainer = styled.div`
  background-color: ${props => props.theme.colors.background};
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: ${props => props.theme.borderRadius};
  padding: ${props => props.theme.space.large};
  margin-bottom: ${props => props.theme.space.large};
  box-shadow: ${props => props.theme.boxShadow};
`;

const Title = styled.h2`
  color: ${props => props.theme.colors.primary};
  margin-bottom: ${props => props.theme.space.medium};
`;

const Action = styled.div`
  background-color: ${props => props.theme.colors.white};
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: ${props => props.theme.borderRadius};
  padding: ${props => props.theme.space.medium};
  margin-bottom: ${props => props.theme.space.small};

  &:hover {
    box-shadow: ${props => props.theme.boxShadow};
  }
`;

const SupportButton = styled.button`
  background-color: ${props => props.theme.colors.secondary};
  color: ${props => props.theme.colors.white};
  padding: ${props => props.theme.space.small} ${props => props.theme.space.medium};
  border: none;
  border-radius: ${props => props.theme.borderRadius};
  cursor: pointer;

  &:hover {
    opacity: 0.8;
  }
`;

const ActionDetails = styled.div`
  background-color: ${props => props.theme.colors.background};
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: ${props => props.theme.borderRadius};
  padding: ${props => props.theme.space.medium};
  margin-top: ${props => props.theme.space.small};
`;

const CloseButton = styled.button`
  background-color: ${props => props.theme.colors.error};
  color: ${props => props.theme.colors.white};
  padding: ${props => props.theme.space.small};
  border: none;
  border-radius: ${props => props.theme.borderRadius};
  cursor: pointer;
  float: right;

  &:hover {
    opacity: 0.8;
  }
`;

function PendingActions() {
    const [pendingActions, setPendingActions] = useState([]);
    const [selectedAction, setSelectedAction] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        fetchPendingActions();
    }, []);

    const fetchPendingActions = () => {
        getPendingActions()
            .then(actions => {
                console.log('Fetched pending actions:', actions);
                setPendingActions(actions);
            })
            .catch(err => {
                console.error('Error fetching pending actions:', err);
                setError('Failed to fetch pending actions');
            });
    };

    const handleSupport = async (actionId) => {
        try {
            await supportAction(actionId, true);
            fetchPendingActions();  // Refresh the list after supporting
        } catch (err) {
            console.error('Error supporting action:', err);
            setError('Failed to support action');
        }
    };

    const handleCloseDetails = () => {
        setSelectedAction(null);
    };

    if (error) return <p>Error: {error}</p>;

    return (
        <PendingActionsContainer>
            <Title>Pending Actions</Title>
            {pendingActions.map(action => (
                <Action key={action.id}>
                    <h3>{action.actionTitle}</h3>
                    <p>Type: {action.actionType}</p>
                    <p>Bet Amount: {action.betAmount}</p>
                    <SupportButton onClick={() => handleSupport(action.id)}>Support</SupportButton>
                </Action>
            ))}
            {selectedAction && (
                <ActionDetails>
                    <CloseButton onClick={handleCloseDetails}>X</CloseButton>
                    <h3>{selectedAction.actionTitle} Details</h3>
                    <p>Type: {selectedAction.actionType}</p>
                    <p>Bet Amount: {selectedAction.betAmount}</p>
                    <SupportButton onClick={() => handleSupport(selectedAction.id)}>Confirm Support</SupportButton>
                </ActionDetails>
            )}
        </PendingActionsContainer>
    );
}

export default PendingActions;
